Condition : 3 - Before the relevant part of the work is begun, detailed drawings, or samples of materials as appropriate, in respect of the following, shall be submitted to and approved in writing by the local planning authority: 

a) Plan, elevation and section drawings, at 1:10 of all windows (including jambs, head and cill) and external doors; 

b) Plan, elevation and section drawings of the new front gate to lane at a scale of 1:10; 

c) Manufacturer's specification details of all facing materials (to be submitted to the Local Planning Authority) and samples of those materials (to be provided on site).   

d) Plan and elevation drawings, at 1:10/1:50 of the integrated timber cladding louvres to the first floor front window to dwelling labelled '25f' in plans hereby approved. Details shall include marked up plans that demonstrate that views are obscured from this window towards facing elevations at no.25b Frognal and details of methods of fixing to ensure that angles are not adjustable; and

e) Details of precast coping including either plan, elevation and section drawings at a scale of 1:10 and/or a typical sample;

The relevant part of the works shall be carried out in accordance with the details thus approved and retained and maintained as such in perpetuity. All approved samples shall be retained on site during the course of the works. 

Reason:  To safeguard the appearance of the premises and the character of the immediate area and to safeguard the amenities of the adjoining dwelling in accordance with the requirements of policy D1, D2 and A1 of the London Borough of Camden Local Plan 2017

Condition : 18 - The development herby approved shall not proceed other than in complete accordance with the measures and recommendations set out in the following approved documents:
a) Energy Statement prepared by Planning for Sustainability rev 01 (dated Nov/18); 
b) Sustainability Statement prepared by Planning for Sustainability rev 01 (dated Nov/18);
c) Sustainability Drainage design report prepared by Planning for Sustainability rev 01 (dated Nov/18);
d) Air Quality (rev 01 dated Nov '18) and Air Quality Dispersion Modelling (rev 01 dated Sept/19) statements prepared by Planning for Sustainability 

Such measures shall be permanently retained and maintained thereafter

Reason: To ensure that the development minimises the effects of climate change, utilises appropriate climate change adaptation measures, ensures that development does not increase flood risk and reduces the risk of flooding and to ensure that the impact of development on air quality is appropriately mitigated. This remains in accordance with policies G1, C1, CC1, CC2 and CC4 of the London Borough of Camden Local Plan 2017

Condition : 20 - No development shall take place until an ecology method statement for a precautionary working approach to demolition and construction has been submitted to and approved in writing by the local planning authority.  This shall include: 

a) an updated bat roosting assessment of all trees on site to determine their value to roosting bats. If evidence of roosts are found then a targeted bat survey on high value trees should also then be provided with an accompanying mitigation strategy; 

b) detailed proposals for vegetation clearance in response to the above, demonstrating that all removal of trees, hedgerows, shrubs, scrub or tall herbaceous vegetation shall be undertaken between September and February inclusive.  If this is not possible then a suitably qualified ecologist shall check the areas concerned immediately prior to the clearance works to ensure that no nesting or nest-building birds are present.  If any nesting birds are present then the vegetation shall not be removed until the fledglings have left the nest;

c) Precautionary approaches to mitigate the impact on bats, badgers and hedgehogs during construction, including impact from lighting;  

All site operatives must be made aware of the possible presence of protected species during works.  If any protected species or signs of protected species are found, works should stop immediately and an ecologist should be contacted.  The applicant may need to apply for a protected species licence from Natural England, evidence of which should be submitted to the local planning authority.

Reason: In order to secure appropriate features to conserve and enhance wildlife habitats and biodiversity measures within the development, in accordance with the requirements of policies A3 and CC2 of the London Borough of Camden Local Plan 2017
